import React,{Component} from 'react';
import {Link} from "react-router-dom";
class Products extends Component{
    render(){
        return(
            <div className="row">
            <div className="col-xl-4 right-item-cat">
                <div className="product">
                    <div className="img">
                        <Link to={`/product/${1}/detail`}
                            onClick={this.getItemData}>
                            <img src="https://xwatch.vn/images/products/2020/04/28/large/dongho-ogival-og35861agr-gl-avatar_1588061214.jpg" />
                        </Link>
                    </div>
                    <div className="contend-item">
                        <h2>"OG358.61AGR-GL"</h2>
                        <div style={{ fontSize: 14, marginLeft: '-10px' }}>Ogival Nam - 42mm - Kính Sapphire</div>
                        <h2 style={{ color: "red" }}>20.780.000₫</h2>
                    </div>
                </div>
            </div>
            </div>   
        )
    }
}
export default Products;
